package com.cos.blog.test;import lombok.Data;import lombok.Getter;import lombok.Setter;public class Member {   public int getId() {      return id;   }   public String getPassword() {      return password;   }   public String getEmail() {      return email;   }   public String getUsername() {      return username;   }   public void setEmail(String email) {      this.email = email;   }   public void setId(int id) {      this.id = id;   }   public void setPassword(String password) {      this.password = password;   }   public void setUsername(String username) {      this.username = username;   }   public Member(int id, String username, String password, String email) {      this.id = id;      this.username = username;      this.password = password;      this.email = email;   }   private int id;   private String username;   private String password;   private String email;}